informacaoComplementar:
Possibilitar a realização transferência da titularidade do imóvel do União para o Campus, que encontra-se pendente;

Possibilitar a realização da retificação das medidas perimetrais da área do Campus da Matrícula n° 25.080/CRI/Cáceres, uma vez que as medidas constantes no documento não fecham o perímetro, ou seja, estão incorretas;

Possibilitar a realização da averbação das áreas construídas, ainda não averbadas na escritura do imóvel;

Garantir ao Campus a documentação atualizada referente ao conjunto de obras  existente no Campus, a ser utilizada para várias finalidades como registro obrigatório dos imóveis nos sistemas Spiunet e Spunet, para auxiliar na avaliação de imóveis do Campus,  para disposição de dados para processos de manutenção predial, entre outros.
